const express = require('express');
const bodyParser = require('body-parser');
const cors = require('cors');
const app = express();

var currentUser;

var corsOptions = {
  orgim: '/',
  optionsSuccessStatus: 200
}

app.use(cors(corsOptions));
app.use(bodyParser.json());

app.listen(3100, () => {
  console.log('Server Started!');
});

app.route('/api/usuario').get((request, response) => {
  response.send(USUARIOS);
});

app.route('/api/usuario').post((request, response) => {
  let usuario = request.body;
  console.log(request);

  const firstId = USUARIOS ? Math.max.apply(null, USUARIOS.map(usuarioIterator => usuarioIterator.id)) + 1 : 1;
  usuario.id = firstId;
  USUARIOS.push(usuario);

  response.status(201).send(usuario);
});

app.route('/api/usuario/:id').put((request, response) => {
  const usuarioId = +request.params['id'];
  const usuario = request.body;
  console.log(request);

  const index = USUARIOS.findIndex(usuarioIterator => usuarioIterator.id === usuarioId);
  USUARIOS[index] = usuario;

  response.status(200).send(usuario);
});

app.route('/api/usuario/:id').get((request, response) => {
  const usuarioId = +request.params['id'];

  response.status(200).send(USUARIOS.find(usuarioIterator => usuarioIterator.id === usuarioId));
});

app.route('/api/usuario/:id').delete((request, response)=> {
  const usuarioId = +request.params['id'];
  USUARIOS = USUARIOS.filter(usuarioIterator => usuarioIterator.id !== usuarioId);
  
  response.status(204).send({});
});

